v.x:
var $bm_rt;
var arr, r, g, b, a, r, g, b;
$bm_rt = arr = thisComp.layer('{COLOR_1}').text.sourceText.split(',');
if (arr.length > 1) {
    r = arr[0];
    g = arr[1];
    b = arr[2];
    a = arr[3];
    $bm_rt = [
        r,
        g,
        b,
        a
    ];
} else {
    r = 255;
    g = 180;
    b = 0;
    $bm_rt = [
        r / 255,
        g / 255,
        b / 255,
        1
    ];
}

